import * as React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import { Layout, Menu} from "antd"

import PrivateComponent from "../../pages/private"
import styles from "./styles.modules.scss"

const { Header, Content, Footer } = Layout;

const PRouter = ()=>{
  return (
    <Router>
      <>
        <Route exact={true} path="/private" component={PrivateComponent} />
        <Route render={() => <Redirect to="/private" />} />
      </>
    </Router>
  )
}

class PrivateRouter extends React.Component {
  render() {
    console.log(styles);
    return (
      <Layout className={`${styles.mainLayout} layout`}>
        <Header>
          <div className="logo" />
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
            <Menu.Item key="1">nav 1</Menu.Item>
            <Menu.Item key="2">nav 2</Menu.Item>
            <Menu.Item key="3">nav 3</Menu.Item>
          </Menu>
        </Header>
        <Content style={{ padding: '0 50px' }}>
          <div className="site-layout-content">
            <PRouter />
          </div>
        </Content>
        <Footer style={{ textAlign: 'center' }}>Ant Design Â©{new Date().getFullYear()} Created by Ant UED</Footer>
      </Layout>
    );
  }
}

export default PrivateRouter ;
